I am in complete agreement with Louis and Terry, these units require a form of extraction to be available.
Increasing requirements mean we have to minimise dust release from work activities. 
We cannot approve purchase of the saws without suitable extraction being available and assurances it will be used.

Having used these personally there are combined saw and vacuum mobile options which enable the user to cart the items freely without the need for a trolley.

Vacuum units should be suitably designed to enable decontamination of the unit.
The recently approved VIRKON wipe system should be OK for the majority, with equipment only requiring BIOQUIL where there are organisms of special interest present e.g. CRO.

There are other options which could be considered and I defer back to Louis as the best to advise.
Extraction only requires a flexible tube from the saw to a vacuum.
If there are mini-vacs available that can be attached via this approach or, minimally modified to accept the flexible tube this would provide another option.
The benefits here less bulky and battery operated.

Regards Andrew   
!';
